import React, { Component } from 'react';

class Main extends Component {
  render() {
    return (
      <main key="main" className="main__container">
        <SearchForm
          changeInput={this._handleOnChange}
        />
        {this._getFilteredPokemons()}
      </main>
    );
  }
}

export default Main;
